import React, { container } from 'react'
import { Container, Row, Col, Card } from "react-bootstrap";

export default class Myfooter extends Component {
    render() {
        return (
           <Container>
               <Row>
                <Col className= "sm-12 lg-12">
                <footer>
                    <p>copyrights reserved by me </p>
                </footer>
                </Col>
               </Row>
           </Container>
        )
    }
}
